import React from 'react';

function VerificacaoLogin({ onLogin }) {
  return (
    <div>
      <h1>Faça o login</h1>
      <p>Por favor, faça o login para acessar o conteúdo exclusivo.</p>
      <button onClick={onLogin}>Login</button>
    </div>
  );
}

export default VerificacaoLogin;
